  \"Accumulation of contaminants from urban rainfall runoff in blue crabs: A pilot
  study\",\n\t\"tracking_summary\": {\n\t\t\"total\": 17,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2014-04-24T15:02:51.296474\",\n\t\"name\":
  \"accumulation-of-contaminants-from-urban-rainfall-runoff-in-blue-crabs-a-pilot-study\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objective of this pilot study was to
  determine the feasibility of using caged blue crabs Callinectes sapidus to monitor
  accumulation of contaminants in urban runoff during a rainfall even. The study area
  was located within the city limits of Texas City, Texas on the southwest side of
  Galveston Bay. Blue crabs were collected on five occasions from an uncontaminated
  portion of Galveston Bay during the months of June through October, 1992 whenever
  a rainfall event was predicted. Five crabs per holding cage were placed in the urban
  drainage ditches for at least 3 days. One water sample was collected from each location
  5 days after a major rainfall over Texas City. Aluminum and iron were detected at
  the highest concentrations in sediments from the reference area. Aluminum was found
  in all crab samples collected from each area. Results suggested that blue crabs
  can be collected from an uncontaminated portion of an estuary and transported to
  other areas to do an accumulation study.\",\n\t\"license_title\": \"License Not
